import React from "react";

function ContactUs() {
  const contactBoxStyle = {
    backgroundColor: 'rgba(0, 0, 0, 0.5)', // Add transparency to make the text readable
    padding: '20px',
    borderRadius: '10px',
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center mb-4">Contact Us</h2>
      <div className="row">
        <div className="col-md-6" style={contactBoxStyle}>
          <h4 style={{ color: 'white' }}>Our Address</h4>
          <p>123 Main Street</p>
          <p>Cityville, State, Country</p>
        </div>
        <div className="col-md-6" style={contactBoxStyle}>
          <h4 style={{ color: 'white' }}>Contact Information</h4>
          <p>Email: contact@electracart.com</p>
          <p>Phone: +1 (123) 456-7890</p>
        </div>
      </div>
    </div>
  );
}

export default ContactUs;
